import React from "react";
import { Button } from "antd";
import ValidationField from "./ValidationField";
import { withFirebase } from "../Firebase";

function Register(props) {
  return (
    <div>
      <ValidationField
        submit={props.firebase.createUserWithEmailAndPassword}
        errorMessage={
          "Unable to create account. Check connection and try again."
        }
        login={false}
      ></ValidationField>
      <Button
        type="link"
        onClick={() => {
          props.setView(1);
        }}
      >
        Sign in
      </Button>
    </div>
  );
}

export default withFirebase(Register);
